import React, { Component } from 'react';
import hero__img from './images/hero.jpg';
import './Hero.css';

export class Hero extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-6">
                        <h1>Hola! Soy <strong>Manuel Mendoza</strong><br/> 
                        Desarrollador <strong>DeveloperFrontend</strong><br/>
                        en JavaScript <strong>React-js</strong></h1>
                    </div>
                <div className="col-6">
                    <img className="img_hero" src={hero__img} alt="Img_princ"/>
                </div>
            </div>
        </div>
        );
    }
}

export default Hero;
